tables.table_schema:
CREATE TABLE building_occupancy (
    building_id INT PRIMARY KEY,
    occupancy_date DATE,
    occupancy_time TIME,
    number_of_occupants INT
);

CREATE TABLE occupancy_type (
    type_id INT PRIMARY KEY,
    type_name VARCHAR(50) UNIQUE
);

CREATE TABLE space_utilization (
    occupancy_id INT PRIMARY KEY,
    building_id INT,
    type_id INT,
    occupancy_percentage DECIMAL(5,2)
);

CREATE TABLE Building_Information (
    building_id INT,
    building_name VARCHAR(255),
    building_address VARCHAR(255),
    total_floors INT
);

CREATE TABLE Occupancy_Data (
    occupancy_id INT,
    building_id INT,
    floor_number INT,
    occupancy_status VARCHAR(50)
);

CREATE TABLE Space_Utilization (
    space_id INT,
    occupancy_id INT,
    area_used DECIMAL(10, 2),
    utilization_rate DECIMAL(5, 2)
);

CREATE TABLE Energy_Consumption (
    energy_id INT,
    building_id INT,
    energy_type VARCHAR(50),
    consumption DECIMAL(10, 2)
);
